Kernel project The src/lib.rs file contains the code for a simple kernel. The function marked with the #[ostd::main] macro is considered the kernel entry point by OSDK. The kernel will print Hello world from the guest kernel!to the console and then abort. #![no_std]
#![deny(unsafe_code)] use ostd::prelude::*; #[ostd::main]
fn kernel_main() { println!("Hello world from guest kernel!");
} Library project The src/lib.rs of library project only contains a simple kernel mode unit test. It follows a similar code pattern as user mode unit tests. The test module is marked with the #[cfg(ktest)] macro, and each test case is marked with #[ktest]. #![no_std]
#![deny(unsafe_code)] #[cfg(ktest)]
mod tests { use ostd::prelude::*; #[ktest] fn it_works() { let memory_regions = ostd::boot::memory_regions(); assert!(!memory_regions.is_empty()); }
}

