Lints help us improve the code quality and find more bugs. When suppressing lints, the suppression should affect as little scope as possible, to make readers aware of the exact places where the lint is generated, and to make it easier for subsequent committers to maintain such lint. For example, if some methods in a trait are dead code, marking the entire trait as dead code is unnecessary and can easily be misinterpreted as the trait itself being dead code. Instead, the following pattern is preferred: trait SomeTrait { #[allow(dead_code)] fn foo(); #[allow(dead_code)] fn bar(); fn baz();
} There is one exception: If it is clear enough that every member will trigger the lint, it is reasonable to allow the lint at the type level. For example, in the following code, we add #[allow(non_camel_case_types)] for the type SomeEnum, instead of for each variant of the type: #[allow(non_camel_case_types)]
enum SomeEnum { FOO_ABC, BAR_DEF,
}
